"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H10116183\">",
"      <span class=\"h1\">",
"       What is bradycardia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Bradycardia is the term doctors use for when a person&rsquo;s heartbeat is slower than normal.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10116198\">",
"      <span class=\"h1\">",
"       How do normal heartbeats happen?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A normal heartbeat happens when an electrical signal starts in one spot near the top of the heart. This electrical signal follows a path to spread across the heart. As it spreads, the signal causes the heart muscle to squeeze. Each time the heart squeezes (&ldquo;beats&rdquo;), it pumps blood all over the body. Normally, the heart beats in a regular way 60 to 100 times a minute.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10116213\">",
"      <span class=\"h1\">",
"       What causes the heart to beat too slowly?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The heart can beat too slowly if:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Electrical signals don&rsquo;t start often enough.",
"       </li>",
"       <li>",
"        The electrical signal gets slowed down or blocked as it spreads across the heart.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Having a slow heartbeat doesn&rsquo;t always cause problems. Both children and adults can have bradycardia and still be healthy. For example, it is common for athletes to have a slow heartbeat. It is also common for people to have a slower heartbeat when they are sleeping.",
"     </p>",
"     <p>",
"      Certain medicines, especially medicines used to treat heart problems or high blood pressure, can also cause bradycardia.",
"     </p>",
"     <p>",
"      Other times, bradycardia is caused by a problem or condition, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A problem with the heart&rsquo;s electrical system",
"       </li>",
"       <li>",
"        Other heart problems, including recent heart surgery or a heart attack",
"       </li>",
"       <li>",
"        Certain infections",
"       </li>",
"       <li>",
"        Sleep apnea &ndash; This is when people stop breathing for short amounts of time when they are asleep.",
"       </li>",
"       <li>",
"        Anorexia &ndash; This is an eating disorder that makes people lose more weight than is healthy.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10116228\">",
"      <span class=\"h1\">",
"       What are the symptoms of bradycardia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some people have no symptoms.",
"     </p>",
"     <p>",
"      Other people have symptoms with their bradycardia. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feeling light-headed or dizzy",
"       </li>",
"       <li>",
"        Fainting or feeling like you are going to faint",
"       </li>",
"       <li>",
"        Feeling tired, either all the time or only when you exercise",
"       </li>",
"       <li>",
"        Chest pain",
"       </li>",
"       <li>",
"        Trouble breathing",
"       </li>",
"       <li>",
"        Eating less than usual or acting tired (in babies)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10116243\">",
"      <span class=\"h1\">",
"       Should I call my doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you or your child has symptoms of bradycardia, call your doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10116258\">",
"      <span class=\"h1\">",
"       Is there a test for bradycardia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor or nurse will ask about your symptoms and do an exam. During the exam, he or she will check your pulse and listen to your heart.",
"     </p>",
"     <p>",
"      To see if your heartbeat is slower than normal, he or she will do an ECG (also called an &ldquo;electrocardiogram&rdquo; or &ldquo;EKG&rdquo;). An ECG is a test that measures the electrical activity in the heart (",
"      <a class=\"graphic graphic_figure graphicRef53145 \" href=\"UTD.htm?6/63/7154\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Your doctor might want to record your heartbeat over the course of hours or days. If so, he or she will have you wear or carry a heart monitor device around at home (",
"      <a class=\"graphic graphic_figure graphicRef76605 \" href=\"UTD.htm?38/7/39039\">",
"       figure 2",
"      </a>",
"      ). This device will measure and record your heart&rsquo;s electrical activity. You should keep doing your normal activities while you wear or carry the monitor. While you wear the monitor, you should also write down any symptoms you have. That way, your doctor can see if bradycardia is causing your symptoms.",
"     </p>",
"     <p>",
"      After your doctor knows for sure that you have bradycardia, he or she will do tests to look for the cause. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        Tests to see how your heartbeat changes when you get certain medicines",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10116273\">",
"      <span class=\"h1\">",
"       How is bradycardia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on your symptoms and what&rsquo;s causing your bradycardia.",
"     </p>",
"     <p>",
"      People who have no symptoms usually do not need treatment.",
"     </p>",
"     <p>",
"      People who have symptoms will likely need treatment. Your doctor might change or stop any medicines that could be slowing your heartbeat.",
"     </p>",
"     <p>",
"      Some people with bradycardia are treated with a device called a &ldquo;pacemaker.&rdquo; A pacemaker sits under the skin near a person&rsquo;s heart and sends electrical signals to the heart. These signals help the heart beat at a normal rate.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10116288\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?6/49/6931?source=see_link\">",
"       Patient information: Pacemakers (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?36/5/36946?source=see_link\">",
"       Patient information: Syncope (fainting) (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?24/51/25395?source=see_link\">",
"       Patient information: ECG and stress test (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?18/40/19075?source=see_link\">",
"       Patient information: Sick sinus syndrome (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?4/9/4245?source=see_link\">",
"       Patient information: Syncope (fainting) (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?20/16/20741?source=see_link\">",
"       Patient information: Pacemakers (Beyond the Basics)",
"      </a>",
"     </p>",
"    </div>",
