var title_f8_46_8935="MRI of boy with ADEM";
var content_f8_46_8935=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F76694&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F76694&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Brain and spine MRI of a 7 year old boy with acute disseminated encephalomyelitis (ADEM)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 431px; height: 384px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Axial T2-weighted MRI brain images show relatively symmetric high signal intensity in the deep gray matter, including bilateral thalami (panel A). There is also high T2 signal within the left aspect of the pons (panel B). Sagittal T2-weighted MRI of the cervical spine demonstrates expansion/swelling and high signal intensity within the spinal cord (panel C), and corresponding axial T2-weighted MRI reveal that the high signal is mostly posterior (panel D). One month later, T2-weighted axial images demonstrate resolution of the findings in the deep gray matter (panel E) and pons (panel F).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Eric D Schwartz, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
