var title_f8_46_8936="Allergic contact dermatitis mechanism";
var content_f8_46_8936=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F50197&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F50197&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 621px\">",
"   <div class=\"ttl\">",
"    Pathogenesis of contact allergic dermatitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 601px; height: 453px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the afferent phase of ACD, a na&iuml;ve host is exposed (over time) to a low molecular weight hapten, which chemically reacts with epidermal proteins. These epidermal proteins are taken up by cutaneous antigen presenting cells (Langerhans cells and other APC), and trafficked to the local lymph node where education of conventional T-cells occurs. This results in the development of T memory/effector lymphocytes. At the same time during the afferent phase of ACD, innate immunity is also activated. Epidermal glycolipids are released, and presented to invariant NKT-cells, which interact with CD1d bearing B-cells, which produce hapten specific IgM. During the efferent phase, upon re-exposure to the hapten, memory T-cells are mobilized to the site of hapten challenge by hapten specific IgM which fixes complement, and activates endothelial cells, promoting conventional T-lymphocyte trafficking into the challenge site. CD8+ T-lymphocytes, along with innate immune cells such as NK- and NKT-cells, are thought to be effector cells of ACD. This group of cells releases cytokines and mediates cytotoxicity to APC and epidermal KC, resulting in the clinical signs and symptoms of ACD.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Gober MD, Gaspari AA. Allergic contact dermatitis. Curr Dir Autoimmun 2008; 10:1. Copyright &copy; 2008 S. Karger AG, Basel. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
