var title_f8_46_8940="Causes of false negative TST";
var content_f8_46_8940=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F58908&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F58908&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Potential causes of false negative tuberculin tests",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Technical (potentially correctable)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Tuberculin material:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Improper storage (exposure to light or heat)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Contamination, improper dilution, or chemical denaturation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Administration:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Injection of too little tuberculin, or too deeply (should be intradermal)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Administration more than 20 minutes after drawing up into the syringe",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Reading:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Inexperienced or biased reader",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Error in recording",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Biologic (not correctable)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Infections:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Active TB (especially if advanced)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Other bacterial infection (typhoid fever, brucellosis, typhus, leprosy, pertussis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        HIV infection (especially if CD4 count &lt;200)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Other viral infection (measles, mumps, varicella)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Fungal infection (South American blastomycosis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recent live virus vaccination: (measles, mumps, polio)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Immunosuppressive drugs: (corticosteroids, TNF inhibitors, and others)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Metabolic disease: chronic renal failure, severe malnutrition, stress (surgery, burns)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diseases of lymphoid organs: (lymphoma, chronic lymphocytic leukemia, sarcoidosis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Age: infants &lt;6 months, elderly",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
