var title_f8_46_8941="Rhythms with DDD pacemaker";
var content_f8_46_8941=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F52858&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F52858&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Rhythms seen with a normal DDD pacemaker",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 263px; height: 267px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The rhythms that occur in a patient with a DDD pacemaker depend upon the underlying heart rate and atrioventricular nodal conduction. The pacemaker spike is represented in blue. First panel: The pacemaker may be completely inhibited when the sinus rate is greater than the lower rate limit of the pacemaker. Second panel: P-wave synchronous pacing occurs when there is intrinsic atrioventricular nodal delay which is greater than the AV delay in the pacemaker. Third panel: Atrial pacing occurs when the sinus rate falls below the lower limit of the pacemaker and AV nodal conduction is intact. Fourth panel: If there is sinus bradycardia and AV nodal conduction delay, the pacemaker paces both atrium and ventricle, known as AV sequential pacing.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
